import React from "react";

function Education() {
  return (
    <section data-aos="fade-left">
      <h2>Education</h2>
      <p><strong>BCA, Tribhuvan University</strong> – GPA: 3.22/4.0</p>
      <p><strong>+2 Science, Khwopa HSS</strong> – GPA: 2.79/4.0</p>
      <p><strong>SLC, Vidhya Sagar School</strong> – GPA: 3.45/4.0</p>
    </section>
  );
}

export default Education;
